export const valToPercentColor = (val, colormap) => {
  const idx = Math.min(
    Math.max(0, Math.round(val * colormap.length)),
    colormap.length - 1);

  return colormap[idx];
}

export const percentColToD3Rgb = percentCol => {
  const col256 = percentCol.map(elm => Math.round(elm * 255))
  return `rgb(${col256[0]}, ${col256[1]}, ${col256[2]})`;
}

export const valToD3Rgb = (val, colormap) => percentColToD3Rgb(valToPercentColor(val, colormap));

